Timer for Sailing Races with voice. Keeps track of time and reminds you of next actions.

Features:
- voice announcements 1 minute, 30 seconds, 20 seconds and 10 seconds countdown to the action (flag or sound). Choose any combination;
- visual display of current flags state and next flag action;
- list of planned flag actions and sounds for selected sequence;
- configure Individual start sequence (either Rule 26 (with flexible timings), Appendix B 3.26.2 or (5-4-)3-2-1-Green according to World Sailing recommendations) Please contact support if you need a different flag sequence;
- support for team, match and rc racing;
- add custom Class flags for your favourite classes (with a library of emblems);
- set-up start sequences with custom delay between starts and quickly switch between them in just a few taps;
- start sequence immediately (on the next round minute) or on specific time;
- displays time since start for each start in sequence;
- configurable time limits;
- mark first/last finisher;
- race log;
- ability to postpone/abandon or general/individual recall with ability to resume later;
- announces time since start of the race (configurable);
- automatic sync of settings between your devices (via iCloud);
- share you settings with others;
- works when locked to save battery;
- automatic activation of a remote horn via bluetooth or playback of a horn sound.

Happy Race-managment!

InStat makes your training process and performance tech-savvy. We tag every action on the court, link it to the video of the episode and visualize on our video-platform.
